var Slideshow={originalEl:"",holder:"",lenPics:0,activePic:0,arrEls:[],init:function(a){this.originalEl=$("#nojs");this.holder=$("#slideshowholder")[0];this.arrEls=$("#slideshowholder").children();this.lenPics=this.arrEls.length;this.startTimer()},getBodyHeight:function(){return parseInt($("#slideshowholder img").css("height"))+200+"px"},setBodyHeight:function(a){$("body").css("height",a)},updatePic:function(){var a=this;this.originalEl.hide();$(this.holder).show();a.setBodyHeight(a.getBodyHeight());$(this.arrEls[this.activePic]).fadeOut(1e3,function(){a.changePic.call(a)})},changePic:function(){var a=this;this.activePic=this.activePic==this.lenPics-1?0:this.activePic+1;$(this.arrEls[this.activePic]).fadeIn(1e3,function(){a.setBodyHeight("100%")})},startTimer:function(){this.updatePic();var a=this;setTimeout(function(){a.startTimer.call(a)},5e3)}};$(document).ready(function(){Slideshow.init()})